import React from "react";
import ReactDOM from "react-dom";

let currDate = new Date();
currDate = currDate.getHours();

let greetings = "";
if(currDate >= 1 && currDate < 12){
  greetings = "Good Morning"
}

ReactDOM.render(
  <>
      <h1>Hello sir, {greetings} </h1>
  </>
)
